0.07074303925037384, -0.046451132744550705, 0.08708984404802322, -0.04409857839345932, 0.02229640632867813, -0.009425782598555088, 0.10836400091648102, -0.030339546501636505, 0.010845751501619816, 0.010548933409154415, -0.08720643073320389, 0.09644445776939392, 0.059154655784368515, 0.006749702151864767, 0.07110840827226639, 0.030138205736875534, 0.0990510880947113, -0.042285770177841187, 0.09194852411746979, -0.026332752779126167, 0.04515554755926132, -0.05820367485284805, -0.04369359090924263, -0.02322958968579769, 0.06612550467252731, 0.020925790071487427, 0.013118553906679153, -0.02868429385125637, 0.028251919895410538, 0.04380706325173378, 0.049337238073349, 0.031596049666404724, 0.06346794217824936, 0.04761479049921036, -0.01864013448357582, -0.006928094197064638]', NULL, 0, '{\"sentences\": [\"✈️ Hành Trình Khám Phá – Trốn Khỏi Nhịp Sống Thành Phố ở Đà Lạt.\", \"<h3>🍃 Đà Lạt – Thành Phố Của Sương Và Mộng Mơ</h3><p>Tôi chọn Đà Lạt cho kỳ nghỉ ngắn ngày của mình – không phải vì nơi này quá xa lạ, mà bởi mỗi lần đến, nó đều mang một cảm giác rất khác.\", \"Có thể là một sáng se lạnh lang thang ở chợ âm phủ, hoặc một chiều tà nhuốm nắng vàng ở đồi chè Cầu Đất.\", \"Dù là lần thứ mấy, Đà Lạt vẫn luôn khiến tôi thấy bình yên.</p><p><img src=\\\"http://127.0.0.1:8000/storage/uploads/1749409246_da-lat-1-n.jpg\\\"></p><h3>📍 Những Điểm Đến Không Thể Bỏ Qua</h3><p><strong>1.\", \"Đồi cỏ hồng – Bình minh nhuộm màu mộng mị</strong></p><p> Dậy từ 4 giờ sáng, lặng lẽ ngắm mặt trời dần lên trên triền đồi cỏ hồng, tôi như chạm tay vào khoảnh khắc thơ nhất của đất trời.</p><p><strong>2.\", \"Làng Cù Lần – Tìm lại sự nguyên sơ</strong></p><p> Ẩn mình giữa rừng thông, làng Cù Lần là một điểm đến lý tưởng để “chạy trốn” thành phố.\", \"Ở đây có suối mát, cầu gỗ, và những ngôi nhà nhỏ mộc mạc – như một thế giới khác hẳn với nhịp sống số hóa.</p><p><strong>3.\", \"Tiệm cà phê Túi Mơ To – Nhâm nhi giữa mây trời</strong></p><p> Tôi luôn tìm đến một quán cà phê đẹp ở mỗi nơi mình đi.\", \"Ở Đà Lạt, Túi Mơ To là lựa chọn số một.\", \"Ngồi trên ban công nhìn xuống thung lũng, tiếng nhạc xưa hòa cùng hương cà phê đủ khiến bạn chẳng muốn rời đi.</p><h3>🍲 Đặc Sản Gây Nhớ Thương</h3><ul><li><strong>Bánh ướt lòng gà</strong> – Món ăn gây nghiện với sự kết hợp độc đáo giữa bánh ướt mỏng, lòng gà dai dai và nước mắm chua ngọt.</li><li><strong>Lẩu gà lá é</strong> – Vừa ấm bụng, vừa lạ miệng, là lựa chọn tuyệt vời cho đêm lạnh.</li><li><strong>Sữa đậu nành nóng</strong> – Uống ở chợ đêm, vừa nhâm nhi vừa ngắm người qua lại, cảm giác đó khó tả lắm!</li></ul><p><img src=\\\"http://127.0.0.1:8000/storage/uploads/1749409270_thanh-pho-da-lat-2.jpg\\\"></p><p>“Có những chuyến đi không phải để khám phá một vùng đất mới, mà để tìm lại chính mình.”</p><p> Nếu bạn cũng đang cần một khoảng lặng, thì Đà Lạt vẫn ở đó, dịu dàng chờ bạn ghé thăm.\"], \"embeddings\": [[-0.047041259706020355, 0.06961380690336227, 0.04999465495347977, -0.09294158220291138, -0.052965085953474045, 0.037344254553318024, 0.09208346158266068, -0.026338225230574608, 0.05769521743059158, 0.040045492351055145, 0.1372590959072113, -0.10798044502735138, -0.0686827301979065, -0.05436640605330467, 0.02318873628973961, 0.01074010506272316, -0.05489983782172203, 0.01918184384703636, -0.025838222354650497, -0.07249809056520462, 0.009509439580142498, 0.01939142681658268, -0.05126374959945679, 0.08299217373132706, -0.08296331763267517, -0.02586316131055355, 0.07543335855007172, 0.09235415607690811, 0.004212006460875273, -0.018970156088471413, -0.029998477548360825, 0.10604937374591827, 0.0076057580299675465, -0.011412438936531544, 0.002297506434842944, -0.017497753724455833, -0.014426537789404392, -0.07706104218959808, 0.05896609276533127, 0.09441705793142319, -0.030813410878181458, -0.04480719938874245, -0.01337397750467062, -0.12536078691482544, 0.03808555379509926, 0.04406500235199928, -0.04219185560941696, -0.022369559854269028, 0.004857135470956564, 0.04435240849852562, -0.056651629507541656, 0.047979