INSERT INTO `posts` (`id`, `title`, `content`, `tag_id`, `user_id`, `view_count`, `like_count`, `image`, `created_at`, `updated_at`, `status`, `scheduled_at`, `thumbnail`, `des`, `group_id`, `embedding`, `folder_id`, `is_flag`, `vio_embedding`) VALUES
(123, 'Hoa – Những Thiên Thần Im Lặng của Thiên Nhiên', '<h3>🌸 <strong>Hoa – biểu tượng của cảm xúc</strong></h3><p>Không cần lời nói, những đóa hoa có thể thay bạn nói lên những điều thầm kín nhất. Một bó hồng đỏ thay cho lời yêu, một nhành cúc trắng cho nỗi nhớ, hay cánh hướng dương luôn hướng về mặt trời như lòng trung thành không đổi thay.</p><p>Dù là hạnh phúc hay chia xa, hoa luôn có mặt – như một người bạn âm thầm bên cạnh cảm xúc con người.</p><h3>🌼 <strong>Sự ngắn ngủi nhưng rực rỡ</strong></h3><p>Hoa không nở mãi. Cũng như cuộc đời, hoa đẹp nhất khi mong manh nhất. Có thể hôm nay rực rỡ, mai đã phai tàn, nhưng chính sự ngắn ngủi ấy lại khiến ta biết trân trọng từng khoảnh khắc hoa bung nở. Cái đẹp của hoa không nằm ở sự vĩnh cửu, mà nằm ở <strong>sự sống hết mình cho từng ngày tồn tại.</strong></p><h3>🌺 <strong>Hoa trong đời sống thường nhật</strong></h3><p>Hoa không chỉ dành cho những dịp đặc biệt. Một chậu hoa nhỏ nơi góc bàn làm việc, một cành hoa dại trên con đường quê... cũng đủ để xoa dịu tâm hồn, mang lại cảm giác an yên giữa guồng quay vội vã của cuộc sống.</p><p>Hãy để hoa nhắc ta nhớ rằng: <strong>cuộc sống không chỉ là những lo toan – mà còn là những khoảnh khắc thật đẹp, thật nhẹ nhàng.</strong><img src=\"http://127.0.0.1:8000/storage/uploads/1749720185_hoa-hong-Bungari-2-1.jpg\"></p>', 47, 22, 2, 0, NULL, '2025-06-12 02:23:11', '2025-06-13 12:23:14', 'published', NULL, 'http://127.0.0.1:8000/storage/uploads/1749720185_hoa-hong-Bungari-2-1.jpg', 'Hoa – chỉ một chữ ngắn ngủi, nhưng lại ẩn chứa cả một thế giới hương sắc, cảm xúc và ngôn ngữ không lời. Từ thuở xa xưa, loài hoa đã hiện diện trong đời sống con người như một biểu tượng của vẻ đẹp, tình yêu, niềm hy vọng và sự tinh khiết.', NULL, '[-0.06076645478606224, 0.050581157207489014, 0.0006349029717966914, -0.12468034774065018, -0.01751980185508728, -0.024715173989534378, 0.07020415365695953, -0.04489213973283768, 0.03275304287672043, 0.016789725050330162, 0.15558166801929474, -0.0880220979452