19, 0.038794297724962234, -0.054952673614025116, 0.07473232597112656, 0.04164423793554306, -0.013183391653001308, 0.03577457368373871, -0.027618257328867912, 0.02696661837399006, -0.03816095367074013, 0.06153389438986778, -0.0072777364403009415, 0.021277328953146935, -0.009311040863394737, -0.04437695071101189, -0.0008066187729127705, 0.08505574613809586, -0.00490571977570653, 0.018903693184256554, 0.06622999161481857, 0.03420783206820488, 0.017947806045413017, 0.08064302802085876, -0.010251456871628761, 0.025163888931274414, 0.07419485598802567, -0.053091906011104584, 0.037523604929447174]', NULL, 0, '{\"sentences\": [\"Học tập không chỉ để biết – mà để trở thành.\", \"<h3>1.\", \"Học để biết – bước khởi đầu cần thiết</h3><p>Ở giai đoạn đầu, học tập là để biết.\", \"Biết đọc, biết viết, biết làm toán, biết rằng quả đất quay quanh mặt trời.\", \"Đây là bước nền móng giúp chúng ta tồn tại và giao tiếp trong thế giới hiện đại.</p><p>Tuy nhiên, nếu chỉ dừng lại ở việc “biết”, bạn sẽ dễ bị giới hạn trong vùng an toàn.\", \"Học không chỉ là ghi nhớ thông tin – mà là học cách <strong>vận dụng, phân tích và sáng tạo</strong> dựa trên điều đã học.</p><p><br></p><h3>2.\", \"Học để làm – học đi đôi với hành</h3><p>Kiến thức không có giá trị nếu không được ứng dụng.\", \"Khi bạn học một ngôn ngữ, hãy dùng nó để giao tiếp.\", \"Khi học lập trình, hãy thử xây dựng một ứng dụng nhỏ.\", \"Khi học kỹ năng giao tiếp, hãy thử bắt chuyện với một người lạ.</p><p>Việc <strong>học gắn liền với hành động</strong> giúp kiến thức trở nên thực tế hơn, đồng thời rèn luyện sự tự tin và khả năng giải quyết vấn đề.</p><p><br></p><h3>3.\", \"Học để cùng sống – cùng người khác</h3><p>Học tập không phải hành trình đơn độc.\", \"Chúng ta học để hiểu người khác, để làm việc nhóm, để chia sẻ ý tưởng và thấu cảm.\", \"Trong một xã hội ngày càng kết nối, khả năng “cùng học, cùng phát triển” trở nên quan trọng hơn bao giờ hết.</p><p>Người học giỏi không phải người biết hết, mà là người <strong>sẵn sàng học hỏi từ người khác và chia sẻ lại</strong> những gì mình biết.</p><p><br></p><h3>4.\", \"Học để trở thành – hành trình cá nhân hóa</h3><p>Cuối cùng, học tập là để “trở thành”: trở thành phiên bản tốt hơn của chính mình.\", \"Dù bạn học để trở thành một bác sĩ, một nhà văn, hay chỉ đơn giản là một con người sống sâu sắc – mỗi kiến thức bạn tiếp thu đều là một viên gạch trên hành trình phát triển bản thân.</p><p>Học không chỉ để có việc làm tốt, mà còn để hiểu mình muốn gì, giá trị sống là gì, và làm sao sống một cuộc đời có ý nghĩa.</p>\"], \"embeddings\": [[-0.04740053042769432, 0.053485892713069916, 0.011968127451837063, -0.06828150898218155, -0.04009651765227318, -0.03960331156849861, 0.11391869932413101, 0.06587504595518112, 0.048994943499565125, 0.012855850160121918, 0.13577497005462646, -0.11145775020122528, -0.06268640607595444, -0.0485590323805809, -0.021943656727671623, 0.018648026511073112, -0.04901586472988129, -0.0031774628441780806, -0.014882966876029968, -0.0652681514620781, -0.05004522576928139, -0.014580070972442627, 0.013172312639653683, -0.006541562732309103, -0.029377305880188942, -0.01632116734981537, 0.039633508771657944, 0.06715387105941772, 0.078706294298172, -0.07143682986497879, -0.04379979893565178, 0.1439049392938614, -0.07638232409954071, -0.021392054855823517, 0.00726799201220274, -0.003046227851882577, -0.056861512362957, -0.036399681121110916, 0.04407034069299698, 0.06818495690822601, 0.023850664496421814, -0.03129468485713005, 0.03496072441339493, -0.14503131806850433, -0.012327386997640133, 0.08175381273031235, -0.04787246137857437, 0.045858778059482574, -0.038248512893915176, -0.0189093928784132, -0.03815969452261925, -0.007055480498820543, -0.0077682132832705975, 0.08670484274625778, -0.04411143809556961, 0.01683497615158558, -0.004648800939321518, 0.06218889728188515, 0.037451885640621185, -0.021839695051312447, 0.01933955028653145, 0.018523700535297394, -0.02547163888812065, -0.008941343054175377, 0.06369630992412567, -0.0246567