INSERT INTO `posts` (`id`, `title`, `content`, `tag_id`, `user_id`, `view_count`, `like_count`, `image`, `created_at`, `updated_at`, `status`, `scheduled_at`, `thumbnail`, `des`, `group_id`, `embedding`, `folder_id`, `is_flag`, `vio_embedding`) VALUES
(126, 'Chương 1: Tiếng ve đầu mùa', '<h3><br></h3><p>Sân trường như chói sáng hơn thường ngày trong cái nắng đầu hè. Tiếng ve râm ran vọng từ tán phượng đỏ rực khiến lòng người xao động lạ thường. Minh đứng lặng ở hành lang tầng hai, nơi cậu thường ngắm sân trường mỗi giờ ra chơi. Dưới kia, những tà áo dài trắng tung bay trong gió, lẫn trong tiếng cười, tiếng gọi nhau rộn ràng của buổi bế giảng.</p><p>“Vậy là hết thật rồi nhỉ?” – giọng Phương vang lên nhẹ nhàng sau lưng, khiến Minh giật mình.</p><p>Minh không quay lại, chỉ khẽ gật đầu. “Nhanh quá. Mới hôm nào còn ngồi học môn Toán khó nhằn, giờ đã phải chia tay.”</p><p>Cả hai cùng im lặng trong vài giây, như thể đang lắng nghe tiếng ve và lưu giữ khoảnh khắc cuối cùng của tuổi học trò. Dưới sân, An đang chụp hình kỷ yếu cùng lớp, còn Khôi thì mải chạy vòng vòng với chiếc máy ảnh cũ, cố ghi lại từng nụ cười, từng cái ôm, từng cái vẫy tay cuối cùng.</p><p>“Tớ không muốn mùa hè này trôi qua như mọi năm nữa,” Phương khẽ nói, “Không phải kiểu học thêm, ngủ nướng rồi đợi nhập học.”</p><p>Minh quay sang nhìn bạn. “Vậy cậu muốn làm gì?”</p><p>Phương mỉm cười, ánh mắt ánh lên sự quyết tâm:</p><p> “Làm tất cả những điều mà chúng ta chưa từng dám làm. Viết lại một mùa hè thật khác.”</p><p>Minh khẽ cười. Dưới ánh nắng, những cánh phượng bay lả tả, như đồng tình với lời hứa thầm lặng đó. Cậu rút từ balo ra cuốn sổ tay nhỏ, mở ra một trang trống, và viết lên đầu dòng:</p><p> <strong>“Danh sách những điều chưa kể.”</strong></p>', 54, 22, 3, 0, NULL, '2025-06-12 05:36:37', '2025-06-13 21:28:09', 'published', NULL, NULL, 'Khi năm học cuối cấp kết thúc, nhóm bạn gồm Minh, Phương, An và Khôi quyết định tận dụng mùa hè để thực hiện những điều mà họ chưa từng dám làm: từ việc giãi bày cảm xúc giấu kín, đối mặt với nỗi sợ, cho đến hàn gắn những tổn thương. Mùa hè ấy đã thay đổi họ mãi mãi.', NULL, '[-0.025231052190065384, 0.03709614276885986, 0.02000424638390541, -0.07268700003623962, -0.07803770899772644, -0.006238201633095741, 0.073298