98523712, -0.019282056018710136, 0.07692897319793701, 0.03567370027303696, 0.013248573057353497, 0.04982504993677139, -0.003615975845605135, 0.08741161972284317, 0.05099181458353996, 0.012775548733770847, -0.004754180554300547, 0.06991749256849289, -0.04672791808843613, -0.009558314457535744]', 17, 0, '{\"sentences\": [\"Chương 1: Tiếng ve đầu mùa.\", \"<h3><br></h3><p>Sân trường như chói sáng hơn thường ngày trong cái nắng đầu hè.\", \"Tiếng ve râm ran vọng từ tán phượng đỏ rực khiến lòng người xao động lạ thường.\", \"Minh đứng lặng ở hành lang tầng hai, nơi cậu thường ngắm sân trường mỗi giờ ra chơi.\", \"Dưới kia, những tà áo dài trắng tung bay trong gió, lẫn trong tiếng cười, tiếng gọi nhau rộn ràng của buổi bế giảng.</p><p>“Vậy là hết thật rồi nhỉ?” – giọng Phương vang lên nhẹ nhàng sau lưng, khiến Minh giật mình.</p><p>Minh không quay lại, chỉ khẽ gật đầu.\", \"“Nhanh quá.\", \"Mới hôm nào còn ngồi học môn Toán khó nhằn, giờ đã phải chia tay.”</p><p>Cả hai cùng im lặng trong vài giây, như thể đang lắng nghe tiếng ve và lưu giữ khoảnh khắc cuối cùng của tuổi học trò.\", \"Dưới sân, An đang chụp hình kỷ yếu cùng lớp, còn Khôi thì mải chạy vòng vòng với chiếc máy ảnh cũ, cố ghi lại từng nụ cười, từng cái ôm, từng cái vẫy tay cuối cùng.</p><p>“Tớ không muốn mùa hè này trôi qua như mọi năm nữa,” Phương khẽ nói, “Không phải kiểu học thêm, ngủ nướng rồi đợi nhập học.”</p><p>Minh quay sang nhìn bạn.\", \"“Vậy cậu muốn làm gì?”</p><p>Phương mỉm cười, ánh mắt ánh lên sự quyết tâm:</p><p> “Làm tất cả những điều mà chúng ta chưa từng dám làm.\", \"Viết lại một mùa hè thật khác.”</p><p>Minh khẽ cười.\", \"Dưới ánh nắng, những cánh phượng bay lả tả, như đồng tình với lời hứa thầm lặng đó.\", \"Cậu rút từ balo ra cuốn sổ tay nhỏ, mở ra một trang trống, và viết lên đầu dòng:</p><p> <strong>“Danh sách những điều chưa kể.”</strong></p>\"], \"embeddings\": [[-0.07568531483411789, 0.04546409845352173, -0.01928047277033329, -0.04416276887059212, -0.04541587457060814, -0.032180324