(127, 'Chương 2: Hộp thư chưa gửi', '<p>Ba ngày sau lễ bế giảng, Minh mới mở lại ngăn bàn cũ của mình. Trường đã bắt đầu đóng cửa để sửa sang nghỉ hè, nhưng một điều gì đó đã kéo cậu quay lại. Ngăn bàn nơi cậu từng để quên vở, giấu đồ ăn vặt, và... giữ một thứ cậu chưa từng dám mở ra.</p><p>Một chiếc phong bì màu xanh nhạt, bên ngoài chỉ viết:</p><p> <strong>\"Gửi một người chưa biết.\"</strong></p><p>Minh nhớ, cậu từng định gửi nó vào hôm 20/11, nhưng rồi lại ngập ngừng. Không dám ký tên, không dám trao tận tay. Chỉ âm thầm nhét nó vào ngăn bàn – nơi hy vọng rằng ai đó sẽ tìm thấy và hiểu được. Nhưng rồi, không ai tìm thấy. Chỉ có chính Minh, nhiều tháng sau, quay lại và bắt gặp lá thư của chính mình.</p><p>Cậu mở ra. Nét chữ nghiêng nghiêng quen thuộc – chữ của chính cậu – hiện lên rõ ràng:</p><p><br></p><p><strong>“Tớ không biết liệu cậu có bao giờ nhận ra hay không, nhưng tớ đã luôn để ý đến cậu.</strong></p><p><strong>Cái cách cậu giơ tay phát biểu dù sai, cái cách cậu mím môi khi cố nhịn cười, và cái cách cậu nhìn ra sân mỗi chiều học Thể dục.</strong></p><p><strong>Tớ đã muốn nói một điều gì đó vào ngày cuối cùng, nhưng rồi lại thôi. Vì tớ sợ, nếu nói ra, tất cả sẽ khác.”</strong></p><p><br></p><p>Minh gấp lá thư lại, cẩn thận. Cậu không còn buồn nữa. Cậu nhận ra, điều khiến cậu day dứt không phải vì đã không nói, mà vì đã không hành động. Nhưng mùa hè này, mọi thứ có thể bắt đầu lại.</p><p>Chiều hôm đó, Minh gọi điện cho Phương.</p><p>“Cậu còn nhớ danh sách những điều chưa kể không?”</p><p>“Nhớ chứ.”</p><p>“Thêm một dòng nữa đi: Gửi một lá thư thật sự, cho một người thật sự.”</p><p>Đầu dây bên kia là một khoảng im lặng ngắn, rồi Phương bật cười. “Tớ đang viết rồi đây. Cậu sẽ bất ngờ đấy.”</p><p><br></p>', 54, 22, 2, 0, NULL, '2025-06-12 05:38:46', '2025-06-13 11:31:04', 'published', NULL, NULL, 'Khi năm học cuối cấp kết thúc, nhóm bạn gồm Minh, Phương, An và Khôi quyết định tận dụng mùa hè để thực hiện những điều mà họ chưa từng dám làm: từ việc giãi bày cảm xúc giấu kín, đối mặt với nỗi sợ, cho đến hàn gắn những tổn thương. Mùa hè ấy đã thay đổi họ mãi mãi.', NULL, '[-0.10762535035610199, 0.03212982043623924, 0.008111200295388699, -0.08576495945453644, -0.07530520111322403, 0.0018033095402643085, 0.06572847068309784, 0.00433729775249958, 0.06266217678785324, -0.010498231276869774, 0.13768123090267181, -0.06686065346002579, -0.007727907970547676, -0.04751409962773323, 0.012711402028799057, 0.018221646547317505, -0.029849354177713394, 0.09386716037988663, -0.08817479014396667, -0.1205788180232048, 0.005923858378082514, 0.03725718706846237, -0.019828228279948235, 0.02194155380129814, -0.02771173045039177, 0.030096426606178284, -0.013430017046630383, 0.03402918204665184, 0.041906218975782394, -0.027670251205563545, -0.025889847427606583, 0.14085955917835236, -0.038942284882068634, -0.0010461689671501517, 0.008706748485565186, 0.032353151589632034, 0.007716186344623566, -0.01717694289982319, 0.04889889806509018, 0.013734154403209686, 0.003305270802229643, -0.0061306762509047985, 0.009200043976306915, -0.1374281942844391, 0.06936315447092056, -0.030539823696017265, -0.04154171049594879, -0.04375710338354111, -0.011847836896777153, -0.030116932466626167, -0.0587872639298439, 0.09901035577058792, -0.014838030561804771, 0.0844537764787674, -0.05643736943602562, -0.04888247326016426, 0.0025774810928851366, 0.09103481471538544, 0.0593896247446537, -0.044918596744537354, -0.08227601647377014, 0.02439078874886036, -0.03579619899392128, 0.001818099175579846, -0.0008998342673294246, -0.029629342257976532, -0.08573432266712189, -0.05192175135016441, -0.03330489248037338, 0.07759226113557816, -0.010966146364808083, -0.027352413162589073, -0.06595291197299957, 0.025499172508716583, -0.101124607026577, 0.01332235150039196, -0.0175478495657444, 0.03240194544196129, 0.0018445155583322048, -0.09683060646057129, 0.049158401787281036, 0.05950457602739334, 0.11693139374256134, -0.07054959982633591, -0.03666716068983078, 0.0929623544216156, -0