INSERT INTO `threads` (`id`, `user_id`, `content`, `view_count`, `like_count`, `created_at`, `updated_at`, `title`, `type`, `tag_id`, `is_pinned`) VALUES
(21, 20, 'hahahaha', 0, 0, '2025-06-02 00:07:35', '2025-06-02 00:07:35', NULL, 'status', NULL, NULL),
(22, 20, 'hihihihihih', 0, 0, '2025-06-02 00:07:45', '2025-06-02 00:07:45', NULL, 'status', NULL, NULL),
(23, 20, 'hahaha', 0, 0, '2025-06-02 00:07:56', '2025-06-02 00:07:56', NULL, 'status', NULL, NULL),
(29, 21, '<p>💬 Bạn từng muốn viết blog nhưng ngại vì:</p><ul><li>“Tôi không giỏi viết văn”</li><li>“Sợ người khác chê”</li><li>“Không biết bắt đầu từ đâu”</li></ul><p>👉 Nhưng viết blog không nhất thiết phải là nhà văn. Bạn có thể viết:</p><ul><li>Ghi chú học lập trình</li><li>Chia sẻ kinh nghiệm làm đồ án</li><li>Tóm tắt bài học bạn vừa học xong</li></ul><p>📌 Hãy chia sẻ cách bạn vượt qua nỗi sợ viết lách, mẹo để bắt đầu viết, và gợi ý nội dung blog phù hợp với người mới nhé!</p>', 0, 0, '2025-06-05 09:14:46', '2025-06-12 06:23:49', 'Làm thế nào để bắt đầu viết blog cá nhân khi bạn không giỏi viết?', 'topic', 45, 1),
(31, 22, 'Tui mới tạo tài khoản nè mn', 0, 0, '2025-06-12 02:20:46', '2025-06-12 02:20:46', NULL, 'status', NULL, NULL),
(32, 22, '<p>Mỗi loài hoa mang một cá tính, một câu chuyện và một thông điệp riêng biệt. Có loài dịu dàng như hoa cúc, có loài mạnh mẽ như hướng dương, có loài mong manh như hoa anh đào, có loài kiêu sa như mẫu đơn.</p><p>Nếu được chọn để trở thành một loài hoa – bạn nghĩ mình là loài nào?</p>', 0, 0, '2025-06-12 05:17:55', '2025-06-12 06:22:52', 'Nếu bạn là một loài hoa, bạn sẽ là loài hoa nào?', 'topic', 45, 1),
(33, 27, 'Xin chào tôi mới tham gia nè', 0, 0, '2025-06-13 20:23:44', '2025-06-13 20:23:44', NULL, 'status', NULL, NULL),
(34, 28, 'Hiiii', 0, 0, '2025-06-13 20:30:17', '2025-06-13 20:30:17', NULL, 'status', NULL, NULL),
(35, 21, '<p>Mỗi loài hoa đều mang một vẻ đẹp và ý nghĩa riêng. Có loài rực rỡ giữa nắng như hoa hướng dương, có loài lại âm thầm nở trong đêm như hoa quỳnh. Có hoa mang vẻ đẹp kiêu sa như lan, có hoa giản dị mà bền bỉ như cúc dại ven đường.</p><p>Bạn nghĩ mình giống loài hoa nào nhất?</p>', 0, 0, '2025-06-13 21:20:39', '2025-06-14 04:01:36', 'Nếu bạn là một loài hoa, bạn sẽ là loài nào?', 'topic', 45, 1),
(36, 29, 'xin chào các bạn', 0, 0, '2025-06-13 21:27:00', '2025-06-13 21:27:00', NULL, 'status', NULL, NULL),
(37, 29, '<p>Mỗi loài hoa đều mang một vẻ đẹp và ý nghĩa riêng. Có loài rực rỡ giữa nắng như hoa hướng dương, có loài lại âm thầm nở trong đêm như hoa quỳnh. Có hoa mang vẻ đẹp kiêu sa như lan, có hoa giản dị mà bền bỉ như cúc dại ven đường.</p><p>Bạn nghĩ mình giống loài hoa nào nhất?</p>', 0, 0, '2025-06-13 21:30:18', '2025-06-13 21:30:18', 'Nếu bạn là một loài hoa, bạn sẽ là loài nào?', 'topic', 52, 0),
(38, 30, 'Mới tạo tài khoản nè mn ^^', 0, 0, '2025-06-14 02:54:14', '2025-06-14 02:54:14', NULL, 'status', NULL, NULL),
(39, 30, '<p>Mỗi loài hoa đều mang một vẻ đẹp và ý nghĩa riêng. Có loài rực rỡ giữa nắng như hoa hướng dương, có loài lại âm thầm nở trong đêm như hoa quỳnh. Có hoa mang vẻ đẹp kiêu sa như lan, có hoa giản dị mà bền bỉ như cúc dại ven đường.</p><p>Bạn nghĩ mình giống loài hoa nào nhất?</p>', 0, 0, '2025-06-14 02:58:30', '2025-06-14 04:01:21', 'Nếu bạn là một loài hoa, bạn sẽ là loài nào?', 'topic', 45, 1);

